import { BrowserRouter,Router,Route } from "react-router-dom";
import { Home } from "./Pages/Home";
import Profile from "./Pages/Profile";


function App() {
  return (
      <>
     <BrowserRouter>
      <Route path="/" Component={<Home/>}/>
      <Route path="/Profile" Component={<Profile/>}/>
     </BrowserRouter>
      </>
  );
}

export default App;
